import React from "react";

import * as Styled from "./style";
import List, { Order } from "../../molecules/List";
import ListItem from "../../molecules/ListItem";
import Image, { Type } from "../../atoms/Image";
import Title, { Size, Weight } from "../../atoms/Title";
import P from "../../atoms/P";

const ClubNavigation = () => {
  return (
    <Styled.NavContainer>
      <List card={true} order={Order.center}>
        <>
          <Image type={Type.img} src="clubLogo.jpg" circle={true} />
          <Title weight={Weight.l}>동국대학교</Title>
          <P>DNA</P>
        </>
      </List>
    </Styled.NavContainer>
  );
};

export default ClubNavigation;
